import React from "react";
import { Navbar } from "./Navbar";
import ImagesCarousel from "./ImagesCarousel";
import Carousel from "./Carousel";
import ImageSlider from "./ImageSlider";

function Accueil() {
  return (
    <div>
      <Navbar />
      {/* <ImagesCarousel /> */}
      <div>
        {/* <Carousel /> */}
        <ImageSlider />
      </div>
    </div>
  );
}

export default Accueil;
